import React, { useState, useEffect } from "react";
import { useQuery } from "@apollo/client";
import { BITQUERY_INFLOW } from "../utils/links";

export default function AddressTXList({ address, tokenContrat }) {
  console.log(address, tokenContrat, BITQUERY_INFLOW);

  const { loading, error, data } = useQuery(
    BITQUERY_INFLOW(address, tokenContrat)
  );
  if (loading) return "Loading tx list...";
  if (error) return `Error! ${error.message}`;
  console.log(data);
}
